import logo from './logo.svg';
import './App.css';
import profilePic from './profilePic.png';
function App() {
  return (
    <div className="App">
      <header className='header'>
        <div className='title-line'>
        <h1 style={{color:'darkblue'}}>Madhav Tarun</h1>
        <h2 style={{color:'white'}}> / Data Analyst</h2>
        </div>
        <div className="section-navigation" style={{color:'lightgray'}}>
        <a href="#">About Me</a>
        <a href='#'>Skills</a>
        <a href='#'>Projects</a>
        <a href='#'>Certificates</a>
        </div>
      </header>
      <div className="full-profile">
        <img src={profilePic} alt='Madhav-Tarun' className='profile-pic' width={400} height={400}></img>
      </div>
    </div>
  );
}

export default App;
